/* eslint-disable jsx-a11y/alt-text */
import React from "react";
import "./Shared.css";
import "./Footer.css";
import { Footer } from "./Footer";


export const HertzBlack: React.FC = () => {
    return (
        <div className="main">
            <h1 className="intro">You know your RR from your NN.</h1>
            <img id="app" src="./images/hz-black.png" />
            <h2 className="intro">
                Give your PNS the CVC it deserves.
            </h2>

            <h2 className="intro">
                Introducing Hertz-black<span>.</span>
            </h2>

            <h2>Preorder now on the App store.</h2>
            <div className="arguments">
                <img className="arguments-icon" src="./images/preorder.svg" />
            </div>
            <h2>Behaviour, the control of perception.</h2>
            <Footer />
        </div>
    );
};
